import Aux from '../../hoc/Aux';
import BurgerIngedrent from '../Burger/BurgerIngedrent'


const Burger = (props)=>{
    
    return(
        <Aux>
            <div>Toolbar, Sidebar, Backdraw</div>
            
            <main className="Content"> 
            {props.children}
            <BurgerIngedrent type ="bread-top"/>
            <BurgerIngedrent type ="bread-bottom"/>
            </main>
        </Aux>
    );
}

export default Burger
